            "    DepthwiseConvolution(C + 1, In(\"B\", C), 1, 3, 3, stride, stride, 1, 1) +\r\n  " +
            "                  (expandRatio > 1 ? BatchNormActivationDropout(C + 1, In(\"DC\", " +
            "C + 1), activation) : BatchNormActivation(C + 1, In(\"DC\", C + 1), activation)) +" +
            "\r\n                    Convolution(C + 2, In(\"B\", C + 1), DIV8(outputChannels), 1" +
