            "     }\r\n\r\n            return blocks;\r\n        }\r\n\r\n\r\n        public static strin" +
            "g InvertedResidual(UInt A, UInt C, UInt channels, UInt kernel = 3, UInt pad = 1," +
            " bool subsample = false, UInt shuffle = 2, bool se = false, Activations activati" +
            "on = Activations.HardSwish)\r\n        {\r\n            if (subsample)\r\n            " +
            "{\r\n                return\r\n                    Convolution(C, In(\"CC\", A), chann" +
            "els, 1, 1, 1, 1, 0, 0) +\r\n                    BatchNormActivation(C + 1, In(\"C\"," +
            " C), activation) +\r\n                    DepthwiseConvolution(C + 1, In(\"B\", C + " +
            "1), 1, kernel, kernel, 1, 1, pad, pad) +\r\n                    Resampling(C + 1, " +
            "In(\"DC\", C + 1)) +\r\n                    BatchNorm(C + 2, In(\"R\", C + 1)) +\r\n    " +
            "                Convolution(C + 2, In(\"B\", C + 2), channels, 1, 1, 1, 1, 0, 0) +" +
            "\r\n                    BatchNormActivation(C + 3, In(\"C\", C + 2), activation) +\r\n" +
            "                    DepthwiseConvolution(C + 3, In(\"CC\", A), 1, kernel, kernel, " +
            "1, 1, pad, pad) +\r\n                    Resampling(C + 3, In(\"DC\", C + 3)) +\r\n   " +
            "                 BatchNorm(C + 4, In(\"R\", C + 3)) +\r\n                    Convolu" +
            "tion(C + 4, In(\"B\", C + 4), channels, 1, 1, 1, 1, 0, 0) +\r\n                    B" +
            "atchNormActivation(C + 5, In(\"C\", C + 4), activation) +\r\n                    Con" +
            "cat(A + 1, In(\"B\", C + 5) + \",\" + In(\"B\", C + 3));\r\n            }\r\n            e" +
            "lse\r\n            {\r\n                var groupCH = In(\"CHATT\", C + 3); // Channel" +
            " Attention\r\n                var groupSP = In(\"SPATT\", C + 3); // Spatial Attenti" +
            "on\r\n                var strSE = se ?\r\n                    GlobalAvgPooling(In(\"B" +
            "\", C + 3), groupCH) +\r\n                    Convolution(1, groupCH + \"GAP\", DIV8(" +
            "channels), 1, 1, 1, 1, 0, 0, false, groupCH) +\r\n                    BatchNormAct" +
            "ivation(1, groupCH + In(\"C\", 1), activation, groupCH) +\r\n                    Glo" +
            "balMaxPooling(In(\"B\", C + 3), groupCH) +\r\n                    Convolution(2, gro" +
            "upCH + \"GMP\", DIV8(channels), 1, 1, 1, 1, 0, 0, false, groupCH) +\r\n             " +
