            "ductionAvg(1, groupCH + \"CM\", groupSP) +\r\n                    ReductionMax(1, gr" +
            "oupCH + \"CM\", groupSP) +\r\n                    Concat(1, In(groupSP + \"RAVG\", 1) " +
            "+ \",\" + In(groupSP + \"RMAX\", 1), groupSP) +\r\n                    Convolution(1, " +
            "groupSP + In(\"CC\", 1), 1, 7, 7, 1, 1, 3, 3, false, groupSP) +\r\n                 " +
