            ") +\r\n                    Multiply(groupCH + \"CM,\" + groupSP + In(\"B\", 1), groupS" +
            "P) +\r\n                    Concat(A + 1, In(\"LCS\", A) + \",\" + groupSP + \"CM\") :\r\n" +
            "                    Concat(A + 1, In(\"LCS\", A) + \",\" + In(\"B\", C + 3));\r\n\r\n     " +
            "           return\r\n                    Shuffle(A, In(\"CC\", A), shuffle) +\r\n     " +
            "               ChannelSplit(A, In(\"SH\", A), 2, 1, \"L\") + ChannelSplit(A, In(\"SH\"" +
            ", A), 2, 2, \"R\") +\r\n                    Convolution(C, In(\"RCS\", A), channels, 1" +
