            "ctivation) +\r\n                    DepthwiseConvolution(C + 1, In(\"B\", C + 1), 1," +
            " kernel, kernel, 1, 1, pad, pad) +\r\n                    BatchNorm(C + 2, In(\"DC\"" +
            ", C + 1)) +\r\n                    Convolution(C + 2, In(\"B\", C + 2), channels, 1," +
            " 1, 1, 1, 0, 0) +\r\n                    BatchNormActivation(C + 3, In(\"C\", C + 2)" +
            ", activation) +\r\n                    strSE;\r\n            }\r\n        }\r\n\r\n       " +
            " public static string AugmentedInvertedResidual(UInt A, UInt C, UInt channels, U" +
            "Int kernel = 3, UInt pad = 1, bool subsample = false, UInt shuffle = 2, bool se " +
            "= false, Activations activation = Activations.HardSwish)\r\n        {\r\n           " +
            " if (subsample)\r\n            {\r\n                return\r\n                    Conv" +
            "olution(C, In(\"CC\", A), channels, 1, 1, 1, 1, 0, 0) +\r\n                    Batch" +
            "NormActivation(C + 1, In(\"C\", C), activation) +\r\n                    DepthwiseCo" +
