            ", 0) +\r\n                    BatchNormActivation(C + 5, In(\"C\", C + 4), activatio" +
            "n) +\r\n                    Concat(A + 1, In(\"B\", C + 5) + \",\" + In(\"B\", C + 3));\r" +
            "\n            }\r\n            else\r\n            {\r\n                var groupCH = I" +
            "n(\"CHATT\", C + 3); // Channel Attention\r\n                var groupSP = In(\"SPATT" +
