            "ion(1, groupCH + \"GAP\", DIV8(channels), 1, 1, 1, 1, 0, 0, false, groupCH) +\r\n   " +
            "                 BatchNormActivation(1, groupCH + In(\"C\", 1), activation, groupC" +
            "H) +\r\n                    GlobalMaxPooling(In(\"B\", C + 3), groupCH) +\r\n         " +
