            "\n                    Multiply(In(\"B\", C + 3) + \",\" + In(groupCH + \"B\", 3), group" +
            "CH) +\r\n                    ReductionAvg(1, groupCH + \"CM\", groupSP) +\r\n         " +
            "           ReductionMax(1, groupCH + \"CM\", groupSP) +\r\n                    Conca" +
            "t(1, In(groupSP + \"RAVG\", 1) + \",\" + In(groupSP + \"RMAX\", 1), groupSP) +\r\n      " +
            "              Convolution(1, groupSP + In(\"CC\", 1), 1, 7, 7, 1, 1, 3, 3, false, " +
            "groupSP) +\r\n                    BatchNormActivation(1, groupSP + In(\"C\", 1), Act" +
            "ivations.HardSigmoid, groupSP) +\r\n                    Multiply(groupCH + \"CM,\" +" +
            " groupSP + In(\"B\", 1), groupSP) +\r\n                    Concat(A + 1, In(\"LCC\", A" +
            ") + \",\" + groupSP + \"CM\") :\r\n                    Concat(A + 1, In(\"LCC\", A) + \"," +
            "\" + In(\"B\", C + 3));\r\n\r\n                return\r\n                    Shuffle(A, I" +
            "n(\"CC\", A), shuffle) +\r\n                    ChannelSplitRatioLeft(A, In(\"SH\", A)" +
