            "annelSplit(A, In(\"CSRL\", A), 2, 2, \"R2\") +\r\n                    Concat(A, In(\"L1" +
            "CS\", A) + \",\" + In(\"L2CS\", A), \"L\") +\r\n                    Concat(A, In(\"R1CS\", " +
            "A) + \",\" + In(\"R2CS\", A), \"R\") +\r\n                    Convolution(C + 2, In(\"RCC" +
