            "+ 3, In(\"C\", C + 2), activation) +\r\n                    strSE;\r\n            }\r\n " +
            "       }\r\n\r\n        internal static string Generate(ScriptParameters p)\r\n       " +
            " {\r\n            var net =\r\n                \"[\" + p.ModelName + \"]\" + nwl +\r\n    " +
            "            \"Dataset=\" + to_string(p.Dataset) + nwl +\r\n                \"Dim=\" + " +
            "to_string(p.C) + \",\" + to_string(p.H) + \",\" + to_string(p.W) + nwl +\r\n          " +
            "      ((p.PadH > 0 || p.PadW > 0) ? (!p.MirrorPad ? \"ZeroPad=\" + to_string(p.Pad" +
            "H) + \",\" + to_string(p.PadW) + nwl : \"MirrorPad=\" + to_string(p.PadH) + \",\" + to" +
            "_string(p.PadW) + nwl) : \"\") +\r\n                ((p.PadH > 0 || p.PadW > 0) ? \"R" +
            "andomCrop=Yes\" + nwl : \"\") +\r\n                \"WeightsFiller=\" + to_string(p.Wei" +
            "ghtsFiller) + (p.WeightsFillerModeVisible ? \"(\" + p.WeightsFillerMode.ToString()" +
            " + \",\" + to_string(p.WeightsGain) + \")\" : \"\") + (p.WeightsGainVisible && !p.Weig" +
            "htsFillerModeVisible ? \"(\" + to_string(p.WeightsGain) + \")\" : \"\") + (p.WeightsSc" +
            "aleVisible ? \"(\" + to_string(p.WeightsScale) + \")\" : \"\") + nwl +\r\n              " +
            "  (p.WeightsLRM != 1 ? \"WeightsLRM=\" + to_string(p.WeightsLRM) + nwl : \"\") +\r\n  " +
            "              (p.WeightsWDM != 1 ? \"WeightsWDM=\" + to_string(p.WeightsWDM) + nwl" +
