            "isible ? \"(\" + to_string(p.BiasesGain) + \")\" : \"\") + (p.BiasesScaleVisible ? \"(\"" +
            " + to_string(p.BiasesScale) + \")\" : \"\") + nwl +\r\n                (p.BiasesLRM !=" +
            " 1 ? \"BiasesLRM=\" + to_string(p.BiasesLRM) + nwl : \"\") +\r\n                (p.Bia" +
            "sesWDM != 1 ? \"BiasesWDM=\" + to_string(p.BiasesWDM) + nwl : \"\") : \"Biases=No\" + " +
            "nwl) +\r\n                (p.DropoutVisible ? \"Dropout=\" + to_string(p.Dropout) + " +
            "nwl : \"\") +\r\n                (p.DepthDropVisible ? \"DepthDrop=\" + to_string(p.De" +
            "pthDrop) + nwl : \"\") +\r\n                (p.DepthDropVisible ? \"FixedDepthDrop=\" " +
            "+ to_string(p.FixedDepthDrop) + nwl : \"\") +\r\n                \"Scaling=\" + to_str" +
            "ing(p.BatchNormScaling) + nwl +\r\n                \"Momentum=\" + to_string(p.Batch" +
            "NormMomentum) + nwl +\r\n                \"Eps=\" + to_string(p.BatchNormEps) + nwl " +
            "+ nwl;\r\n\r\n            var blocks = new List<string>();\r\n\r\n            switch (p." +
            "Script)\r\n            {\r\n                case Scripts.augshufflenet:\r\n           " +
            "         {\r\n                        var channels = DIV8(p.Width * 16);\r\n\r\n      " +
            "                  net +=\r\n                            Convolution(1, \"Input\", ch" +
            "annels, 3, 3, p.StrideHFirstConv, p.StrideWFirstConv, 1, 1) +\r\n                 " +
            "           BatchNormActivation(1, \"C1\", p.Activation) +\r\n                       " +
            "     Convolution(2, \"B1\", channels, 1, 1, 1, 1, 0, 0) +\r\n                       " +
            "     BatchNormActivation(2, \"C2\", p.Activation) +\r\n                            D" +
            "epthwiseConvolution(3, \"B2\", 1, 3, 3, 1, 1, 1, 1) +\r\n                           " +
            " BatchNorm(3, \"DC3\") +\r\n                            Convolution(4, \"B3\", channel" +
            "s, 1, 1, 1, 1, 0, 0) +\r\n                            BatchNormActivation(4, \"C4\"," +
            " p.Activation) +\r\n                            Convolution(5, \"B1\", channels, 1, " +
            "1, 1, 1, 0, 0) +\r\n                            Concat(1, \"C5,B4\");\r\n\r\n           " +
            "             var C = 6ul;\r\n                        var A = 1ul;\r\n               " +
            "         var subsample = false;\r\n                        foreach (var rec in p.S" +
            "huffleNet)\r\n                        {\r\n                            if (subsample" +
            ")\r\n                            {\r\n                                channels *= 2;" +
            "\r\n                                net += AugmentedInvertedResidual(A++, C, chann" +
            "els, rec.Kernel, rec.Pad, true, rec.Shuffle, rec.SE, p.Activation);\r\n           " +
