            "         for (var n = 0ul; n < rec.Iterations; n++)\r\n                           " +
            " {\r\n                                net += AugmentedInvertedResidual(A++, C, cha" +
            "nnels, rec.Kernel, rec.Pad, false, rec.Shuffle, rec.SE, p.Activation);\r\n        " +
