            "            subsample = true;\r\n                        }\r\n\r\n                    " +
            "    net +=\r\n                            Convolution(C, In(\"CC\", A), p.Classes, 1" +
            ", 1, 1, 1, 0, 0) +\r\n                            BatchNorm(C + 1, In(\"C\", C)) +\r\n" +
