            "et, p.Classes, \"CategoricalCrossEntropy\", 0.125f);\r\n                    }\r\n     " +
            "               break;\r\n\r\n                case Scripts.densenet:\r\n               " +
            "     {\r\n                        var channels = DIV8(p.GrowthRate);\r\n\r\n          " +
