            "                             (p.Dropout > 0 ? Dropout(C, In(\"C\", C)) + Concat(CC" +
            " + 1, In(\"CC\", CC) + \",\" + In(\"D\", C)) : Concat(CC + 1, In(\"CC\", CC) + \",\" + In(" +
            "\"C\", C))));\r\n\r\n                                    C++;\r\n                       " +
            "         }\r\n\r\n                                CC++;\r\n                           " +
            "     channels += DIV8(p.GrowthRate);\r\n                            }\r\n\r\n         " +
            "                   if (g < p.Groups)\r\n                            {\r\n           " +
