            "     AvgPooling(g, In(\"D\", C), \"2,2\", \"2,2\", \"0,0\"));\r\n                         " +
            "       else\r\n                                    blocks.Add(\r\n                  " +
            "                      Convolution(C, \"CC\" + to_string(CC), channels, 1, 1, 1, 1," +
            " 0, 0) +\r\n                                        AvgPooling(g, In(\"C\", C), \"2,2" +
            "\", \"2,2\", \"0,0\"));\r\n                                C++;\r\n                      " +
            "          CC++;\r\n\r\n                                if (p.Bottleneck)\r\n          " +
            "                      {\r\n                                    blocks.Add(\r\n      " +
            "                                  BatchNormActivation(C, In(\"P\", g), p.Activatio" +
            "n) +\r\n                                        Convolution(C, In(\"B\", C), DIV8(4 " +
            "* p.GrowthRate), 1, 1, 1, 1, 0, 0) +\r\n                                        Ba" +
            "tchNormActivation(C + 1, In(\"C\", C), p.Activation) +\r\n                          " +
            "              Convolution(C + 1, In(\"B\", C + 1), DIV8(p.GrowthRate), 3, 3, 1, 1," +
            " 1, 1) +\r\n                                        (p.Dropout > 0 ? Dropout(C + 1" +
            ", In(\"C\", C + 1)) + Concat(CC, In(\"B\", C) + \",\" + In(\"D\", C + 1)) : Concat(CC, I" +
            "n(\"B\", C) + \",\" + In(\"C\", C + 1))));\r\n\r\n                                    C +=" +
            " 2;\r\n                                }\r\n                                else\r\n  " +
            "                              {\r\n                                    blocks.Add(" +
            "\r\n                                        BatchNormActivation(C, In(\"P\", g), p.A" +
            "ctivation) +\r\n                                        Convolution(C, In(\"B\", C)," +
            " DIV8(p.GrowthRate), 3, 3, 1, 1, 1, 1) +\r\n                                      " +
            "  (p.Dropout > 0 ? Dropout(C, In(\"C\", C)) + Concat(CC, In(\"B\", C) + \",\" + In(\"D\"" +
            ", C)) : Concat(CC, In(\"B\", C) + \",\" + In(\"C\", C))));\r\n\r\n                        " +
            "            C++;\r\n                                }\r\n\r\n                         " +
            "       channels += DIV8(p.GrowthRate);\r\n                            }\r\n         " +
